(1, '{\"en\":\"V\\u00e0i n\\u00e9t v\\u1ec1\",\"vi\":\"V\\u00e0i n\\u00e9t v\\u1ec1\"}', '{\"en\":\"T\\u1eadp \\u0110o\\u00e0n Trung Thu\\u1ef7\",\"vi\":\"T\\u1eadp \\u0110o\\u00e0n Trung Thu\\u1ef7\"}', '{\"en\":\"Th\\u00e0nh l\\u1eadp t\\u1eeb n\\u0103m 1985, T\\u1eadp \\u0111o\\u00e0n Trung Th\\u1ee7y t\\u1ef1 h\\u00e0o l\\u00e0 th\\u01b0\\u01a1ng hi\\u1ec7u ph\\u00e1t tri\\u1ec3n b\\u1ea5t \\u0111\\u1ed9ng s\\u1ea3n h\\u00e0ng \\u0111\\u1ea7u t\\u1ea1i Vi\\u1ec7t Nam; lu\\u00f4n n\\u1ed7 l\\u1ef1c ki\\u1ebfn t\\u1ea1o nh\\u1eefng kh\\u00f4ng gian s\\u1ed1ng \\u0111\\u1ea7y t\\u00ednh m\\u1ef9 thu\\u1eadt nh\\u1eb1m n\\u00e2ng cao ch\\u1ea5t l\\u01b0\\u1ee3ng s\\u1ed1ng con ng\\u01b0\\u1eddi c\\u0169ng nh\\u01b0 duy tr\\u00ec nh\\u1eefng gi\\u00e1 tr\\u1ecb b\\u1ec1n v\\u1eefng cho th\\u1ebf h\\u1ec7 mai sau.\",\"vi\":\"Th\\u00e0nh l\\u1eadp t\\u1eeb n\\u0103m 1985, T\\u1eadp \\u0111o\\u00e0n Trung Th\\u1ee7y t\\u1ef1 h\\u00e0o l\\u00e0 th\\u01b0\\u01a1ng hi\\u1ec7u ph\\u00e1t tri\\u1ec3n b\\u1ea5t \\u0111\\u1ed9ng s\\u1ea3n h\\u00e0ng \\u0111\\u1ea7u t\\u1ea1i Vi\\u1ec7t Nam; lu\\u00f4n n\\u1ed7 l\\u1ef1c ki\\u1ebfn t\\u1ea1o nh\\u1eefng kh\\u00f4ng gian s\\u1ed1ng \\u0111\\u1ea7y t\\u00ednh m\\u1ef9 thu\\u1eadt nh\\u1eb1m n\\u00e2ng cao ch\\u1ea5t l\\u01b0\\u1ee3ng s\\u1ed1ng con ng\\u01b0\\u1eddi c\\u0169ng nh\\u01b0 duy tr\\u00ec nh\\u1eefng gi\\u00e1 tr\\u1ecb b\\u1ec1n v\\u1eefng cho th\\u1ebf h\\u1ec7 mai sau.\"}', '{\"vi\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, 'slider_home1', 'slider_home', NULL, '2022-10-04 04:22:07', '2022-10-04 04:28:27'),
(2, '{\"vi\":\"\"}', '{\"en\":\"lancaster club\",\"vi\":\"lancaster club\"}', '{\"en\":\"Lancaster Club ki\\u1ebfn t\\u1ea1o n\\u00ean c\\u1ed9ng \\u0111\\u1ed3ng tinh hoa \\u01b0u vi\\u1ec7t, n\\u01a1i nh\\u1eefng t\\u00e2m h\\u1ed3n \\u0111\\u1ed3ng \\u0111i\\u1ec7u v\\u1ec1 ch\\u1ea5t s\\u1ed1ng giao l\\u01b0u v\\u00e0 chia s\\u1ebb c\\u00e1c gi\\u00e1 tr\\u1ecb th\\u00e0nh c\\u00f4ng; m\\u1edf ra c\\u00e1nh c\\u1eeda tr\\u1ea3i nghi\\u1ec7m kh\\u00f4ng gi\\u1edbi h\\u1ea1n v\\u00e0 mang \\u0111\\u1ebfn nhi\\u1ec1u \\u01b0u \\u0111\\u00e3i v\\u00f4 c\\u00f9ng h\\u1ea5p d\\u1eabn cho ch\\u1ee7 nh\\u00e2n s\\u1edf h\\u1eefu.\",\"vi\":\"Lancaster Club ki\\u1ebfn t\\u1ea1o n\\u00ean c\\u1ed9ng \\u0111\\u1ed3ng tinh hoa \\u01b0u vi\\u1ec7t, n\\u01a1i nh\\u1eefng t\\u00e2m h\\u1ed3n \\u0111\\u1ed3ng \\u0111i\\u1ec7u v\\u1ec1 ch\\u1ea5t s\\u1ed1ng giao l\\u01b0u v\\u00e0 chia s\\u1ebb c\\u00e1c gi\\u00e1 tr\\u1ecb th\\u00e0nh c\\u00f4ng; m\\u1edf ra c\\u00e1nh c\\u1eeda tr\\u1ea3i nghi\\u1ec7m kh\\u00f4ng gi\\u1edbi h\\u1ea1n v\\u00e0 mang \\u0111\\u1ebfn nhi\\u1ec1u \\u01b0u \\u0111\\u00e3i v\\u00f4 c\\u00f9ng h\\u1ea5p d\\u1eabn cho ch\\u1ee7 nh\\u00e2n s\\u1edf h\\u1eefu.\"}', '{\"vi\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, 'slider_home2', 'slider_home', NULL, '2022-10-04 16:03:34', '2022-10-04 16:04:15'),
(3, '{\"vi\":\"\"}', '{\"en\":\"lancaster \\nthe master\",\"vi\":\"lancaster \\nthe master\"}', '{\"en\":\"N\\u00e2ng t\\u1ea7m tr\\u1ea3i nghi\\u1ec7m s\\u1ed1ng th\\u00f4ng qua c\\u00e1c d\\u1ecbch v\\u1ee5 \\u0111\\u1eb7c quy\\u1ec1n c\\u00f9ng s\\u1ef1 tinh t\\u1ebf trong c\\u00e1ch ph\\u1ee5c v\\u1ee5, m\\u1ed9t d\\u1ea5u \\u1ea5n ri\\u00eang, \\u0111\\u1ecbnh h\\u00ecnh phong c\\u00e1ch v\\u00e0 gi\\u00e1 tr\\u1ecb c\\u1ee7a Lancaster The Master trong l\\u00f2ng kh\\u00e1ch h\\u00e0ng. M\\u1ed9t \\u0111\\u1ed9i ng\\u0169 \\u201cqu\\u1ea3n gia\\u201d t\\u1eadn t\\u1ee5y, ch\\u0103m ch\\u00fat t\\u1eeb nh\\u1eefng \\u0111i\\u1ec1u nh\\u1ecf nh\\u1eb7t nh\\u1ea5t \\u0111\\u1ec3 mang \\u0111\\u1ebfn t\\u1ed5 \\u1ea5m an y\\u00ean cho m\\u1ecdi gia ch\\u1ee7.\",\"vi\":\"N\\u00e2ng t\\u1ea7m tr\\u1ea3i nghi\\u1ec7m s\\u1ed1ng th\\u00f4ng qua c\\u00e1c d\\u1ecbch v\\u1ee5 \\u0111\\u1eb7c quy\\u1ec1n c\\u00f9ng s\\u1ef1 tinh t\\u1ebf trong c\\u00e1ch ph\\u1ee5c v\\u1ee5, m\\u1ed9t d\\u1ea5u \\u1ea5n ri\\u00eang, \\u0111\\u1ecbnh h\\u00ecnh phong c\\u00e1ch v\\u00e0 gi\\u00e1 tr\\u1ecb c\\u1ee7a Lancaster The Master trong l\\u00f2ng kh\\u00e1ch h\\u00e0ng. M\\u1ed9t \\u0111\\u1ed9i ng\\u0169 \\u201cqu\\u1ea3n gia\\u201d t\\u1eadn t\\u1ee5y, ch\\u0103m ch\\u00fat t\\u1eeb nh\\u1eefng \\u0111i\\u1ec1u nh\\u1ecf nh\\u1eb7t nh\\u1ea5t \\u0111\\u1ec3 mang \\u0111\\u1ebfn t\\u1ed5 \\u1ea5m an y\\u00ean cho m\\u1ecdi gia ch\\u1ee7.\"}', '{\"vi\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, 'slider_home1', 'slider_home', NULL, '2022-10-04 16:26:24', '2022-10-04 17:07:06'),
